// angular.module is a global place for creating, registering and retrieving Angular modules
// 'aka' is the name of this angular module example (also set in a <body> attribute in index.html)
// the 2nd parameter is an array of 'requires'
angular.module('aka', ['ionic'])

.run(function($ionicPlatform) {
  $ionicPlatform.ready(function() {
    if(window.cordova && window.cordova.plugins.Keyboard) {
      // Hide the accessory bar by default (remove this to show the accessory bar above the keyboard
      // for form inputs)
      cordova.plugins.Keyboard.hideKeyboardAccessoryBar(true);

      // Don't remove this line unless you know what you are doing. It stops the viewport
      // from snapping when text inputs are focused. Ionic handles this internally for
      // a much nicer keyboard experience.
      cordova.plugins.Keyboard.disableScroll(true);
    }
    if(window.StatusBar) {
      StatusBar.styleDefault();
    }
  });
})

.directive('validFloat', function() {
  return {
    require: 'ngModel',
    link: function(scope, ele, attrs, c) {
      scope.$watch(attrs.ngModel, function() {

        var regex = new RegExp(/^-?\d*(\.\d+)?$/);

        if(ele.val().match(regex) || parseFloat(ele.val()) > 0)
        {
          c.$setValidity('valid-float', true);
        }
        else
        {
          c.$setValidity('valid-float', false);
        }
      });
    }
  };
})

.controller("HomeController", function($scope,$ionicModal) {

    $scope.fields = {
                    'east' : '',
                    'west' : '',
                    'south' : '',
                    'north' : '',
                    'totalaka' : '',
                    'price' : '',
                    'totalprice' : ''
                  };
  
    $scope.modaltitle = '';
    $scope.modaldescription = '';

    $ionicModal.fromTemplateUrl('popup.html', {
              scope: $scope,
              animation: 'slide-in-down'
      }).then(function(modal) {
              $scope.modal = modal;
      });

    $scope.clearcal = function() {

      $scope.fields = {
                    'east' : '',
                    'west' : '',
                    'south' : '',
                    'north' : '',
                    'totalaka' : '',
                    'price' : '',
                    'totalprice' : ''
                  };

    }
 
    $scope.calfields = function() {
        
        $scope.modaltitle = 'လယ္ဧက';

        $scope.fields.totalaka = parseFloat(((($scope.fields.east + $scope.fields.west) / 2 * ($scope.fields.south + $scope.fields.north) / 2)/1122).toFixed(2));

        $scope.modaldescription = 'စုစုေပါင္း : '+ $scope.fields.totalaka+' ဧက';

        $scope.modal.show();    


    };

    $scope.calprices = function() {
       
        $scope.modaltitle = 'က်သင့္ေငြ';

        $scope.fields.totalprice = parseInt(($scope.fields.price * $scope.fields.totalaka).toFixed(0));

        $scope.modaldescription = 'စုစုေပါင္း : '+ $scope.fields.totalprice+' က်ပ္ တိတိ';

        $scope.modal.show();    
        
    };

    $scope.aboutus = function() {

        $scope.modaltitle = 'About Us';

        $scope.modaldescription =   '<div class="item item-avatar">'+
                                    '<img src="data:image/png;base64,">'+
                                    '<h2>Pro-X</h2>'+
                                    '<p>Software Solution</p>'+
                                    '</div>'+

                                    '<a href="http://www.proxsoftwaresolution.com" class="item item-icon-left" style="text-align: left;">'+
                                    '<i class="icon ion-ios-world"></i>'+
                                    'www.proxsoftwaresolution.com'+
                                    '</a>'+

                                    '<a href="http://www.facebook.com/proxsoftwaresolution" class="item item-icon-left" style="text-align: left;">'+
                                    '<i class="icon ion-social-facebook"></i>'+
                                    'Our Facebook Page'+
                                    '</a>'+

                                    '<a href="mailto:proxsoftwaresolution@gmail.com" class="item item-icon-left" style="text-align: left;">'+
                                    '<i class="icon ion-email"></i>'+
                                    'Email Us'+
                                    '</a>';

        $scope.modal.show();    
        

    };

    $scope.closemodal = function() {
        
        $scope.modal.hide();    

    };

 
});
